import React, { useState } from "react";
import { IconButton } from "rsuite";
import { Search } from "@rsuite/icons";
import { Link } from "react-router-dom";

const Header = () => {
  const [search, setSearch] = useState(false);
  return (
    <header className="header">
      <div className="navbar">
        <h1 className="logoTxt">
          <span className="logo1">Mak</span>
          <span className="logo2">Estate</span>
        </h1>
        {search ? (
          <form className="searchBar">
            <input type="text" placeholder="Search..." />
            <IconButton className="hideSearchIcon" icon={<Search />} onClick={() => setSearch(!search)} />
          </form>
        ) : null}
        {!search ? (
          <IconButton className="searchIcon" icon={<Search />} colo onClick={() => setSearch(!search)} />
        ) : null}
        <ul className="navbarList">
          <Link className="Link homeTab" to="/">
            <li>Home</li>
          </Link>
          <Link className="Link aboutTab" to="/about">
            <li>About</li>
          </Link>
          <Link className="Link" to="/sign-in">
            <li>SignIn</li>
          </Link>
        </ul>
      </div>
    </header>
  );
};

export default Header;
